import { Link } from "react-router-dom";
import React from "react";
function Navbar() {
  return (
    <div className="navbar">
      <div className="navbarTitle">
        <h1>iTech</h1>
      </div>
      <div className="navbarLinks">
        <Link to="/auth" >Login</Link> 
      </div>
    </div>
  );
}

export default Navbar;
